import React, { useContext } from 'react';

import { ThemeContext } from 'styled-components';
import { shade } from 'polished';

import { Container, ContainerPhoto, Title, PerfilPhoto, ContainerTechs, MiddleLine, ContainerTechsLeft, ContainerTechsRight } from './styles';

import perfilPhoto from './img/perfil.png';
import ArtBrowser from '../Arts/Browser';

function Home() {

    const { colors } = useContext(ThemeContext);

    return (
        <Container>

            <ContainerPhoto>
                <Title>BACKEND</Title>
                <PerfilPhoto src={perfilPhoto} />
                <Title>FRONTEND</Title>
            </ContainerPhoto>

            <ContainerTechs>
                <ContainerTechsLeft>
                    <h3>MYSQL</h3>
                    <h3>MONGODB</h3>
                    <h3>NODEJS</h3>
                    <h3>JAVA</h3>
                    <h3>C#</h3>
                </ContainerTechsLeft>

                <MiddleLine />

                <ContainerTechsRight>
                    <h3>HTML/HTML5</h3>
                    <h3>CSS/CSS3</h3>
                    <h3>BOOTSTRAP 4</h3>
                    <h3>JAVASCRIPT</h3>
                    <h3>REACTJS</h3>
                    <h3>PHOTOSHOP</h3>
                    <h3>ILLUSTRATOR</h3>
                </ContainerTechsRight>
            </ContainerTechs>

            <ArtBrowser colorPrimary={shade(0.15, colors.primary)} colorSecondary={shade(0.30, colors.primary)}/>

        </Container>
    );
}

export default Home;
